(2764, 'why-section', 'whysection', 'Why Study in Australia?', NULL, 'Main', 'Normal', NULL, 1, NULL, NULL, 'Australia growing up quickly as a popular study destination among the students around the world. Most of the students go to Australia to study in the vocational education and training system and at university level. The most popular fields of study are business and management, information technology, engineering, and tourism and hospitality. Students these days are increasingly studying in a wide range of disciplines at Australian institutions.<br />\r\nAustralia is the safe, multicultural and internationally recognized environment for further education, innovative research intensive culture and international rapport has made Australia a leading provider of top quality education to international students from all over the world.', NULL, 2763, NULL, NULL, NULL, '/uploads/banner_image/1713281315_shutterstock_590390942v2.jpg', NULL, NULL, NULL, NULL, 'why-section', NULL, '1', '0', NULL, NULL, NULL, '2024-04-10 11:16:24', '2024-04-16 15:28:35', NULL, NULL, NULL, NULL, NULL),
(2765, 'know-more', 'knowmore', 'Know More Detail About Australia', NULL, 'Main', 'Group', NULL, 2, 'Here are detailed view about Australia and its processes to be followed :', NULL, NULL, NULL, 2763, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'know-more', NULL, '1', '0', NULL, NULL, NULL, '2024-04-10 11:18:41', '2024-04-10 11:20:23', NULL, NULL, NULL, NULL, NULL),
(2766, 'Earning While Studying in Australia', 'earning-while-studying-in-australia', 'Earning While Studying in Australia', NULL, 'Main', 'Normal', NULL, 1, 'In Australia, international students can apply for permission to work. Student is permitted to work 20 hrs a week and full-time during vacations. But If you are studying masters or doctorate courses under subclass 574, then you are permitted to work unlimited hours a week.', NULL, NULL, NULL, 2765, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Earning While Studying in Australia', NULL, '1', '0', NULL, NULL, NULL, '2024-04-10 11:21:04', '2024-04-17 10:20:03', NULL, NULL, NULL, NULL, NULL),
(2767, 'Student Visa Process', 'student-visa-process', 'Student Visa Processing', NULL, 'Main', 'Normal', NULL, 2, 'Student visa applicants from India, Nepal and Bhutan are required to undergo a Pre-Visa Assessment (PVA).', NULL, NULL, NULL, 2765, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Student Visa Process', NULL, '1', '0', NULL, NULL, NULL, '2024-04-10 11:23:02', '2024-04-17 10:19:11', NULL, NULL, NULL, NULL, NULL),
(2768, 'Processing Times', 'processing-times', 'Processing Times', NULL, 'Main', 'Normal', NULL, 3, 'Student applicants should lodge applications no more than 3 months and at least 8 weeks before course commencement dates. Some applications take longer to process. Students may be asked to undertake further medicals and some delays may be experienced due to the need to verify bank or education documents. Nepalese and Bhutanese applicants need to take into account the time taken for documents and letters to be sent and received by the Visa Office.<br />\r\nTo be granted a student visa you will need', NULL, NULL, NULL, 2765, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Processing Times', NULL, '1', '0', NULL, NULL, NULL, '2024-04-10 11:23:25', '2024-04-10 17:04:32', NULL, NULL, NULL, NULL, NULL),
(2769, 'Student Visa Processing', 'student-visa-processing', 'Student Visa Process', NULL, 'Main', 'Normal', NULL, 4, 'Process to obtain Australian Student Visa for international students. Any person who intends to undertake full-time study in a registered course in Australia needs to obtain a Australian Student Visa. A Student Visa permits the holder to travel to, enter and remain in Australia for the duration of the registered course of study. Overseas students cannot undertake part-time study in Australia and must leave Australia on completion of their course of study.', NULL, NULL, NULL, 2765, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Student Visa Processing', NULL, '1', '0', NULL, NULL, NULL, '2024-04-10 11:23:44', '2024-04-17 10:19:36', NULL, NULL, NULL, NULL, NULL),
(2770, 'Application', 'application', 'Application', NULL, 'Main', 'Normal', NULL, 5, 'Persons wishing to study in Australia should apply on form 157A and pay the current visa application charge.', NULL, NULL, NULL, 2765, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Application', NULL, '1', '0', NULL, NULL, NULL, '2024-04-10 11:24:01', '2024-04-10 11:24:01', NULL, NULL, NULL, NULL, NULL),
