(2809, 'University-of-Central-Oklahoma-know-more', 'universityofcentraloklahomaknowmore', 'University of Central Oklahomahi Know More', NULL, 'Main', 'Normal', NULL, 1, 'University of Central Oklahoma is a public institution that was founded in 1890. It has a total undergraduate enrollment of 13,331, its setting is suburban, and the campus size is 210 acres. It utilizes a semester-based academic calendar. University of Central Oklahoma\'s ranking in the 2021 edition of Best Colleges is Regional Universities West, #68.', NULL, '<div style=\"text-align: justify;\">\r\n<div style=\"text-align: center;\">\r\n<div style=\"text-align: left;\"><strong>Bachelors&nbsp;Degree</strong><br />\r\nAvariety of Bachelor\'s degree programs in fields related to:&nbsp;</div>\r\n\r\n<ol>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts Management</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Fine Arts in Theatre Management</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts Administration</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts and Cultural Management&nbsp;</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Entertainment Management&nbsp;</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts Management&nbsp;</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts Management&nbsp;</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts Administration&nbsp;</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Fine Arts in Theatre Arts Management&nbsp;</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts Management&nbsp;</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Fine Arts in Theatre Management&nbsp;</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts Administrat