(2810, 'why-canada', 'whycanada', 'Why Study in Canada?', NULL, 'Main', 'Normal', NULL, 1, NULL, NULL, 'Australia growing up quickly as a popular study destination among the students around the world. Most of the students go to Australia to study in the vocational education and training system and at university level. The most popular fields of study are business and management, information technology, engineering, and tourism and hospitality. Students these days are increasingly studying in a wide range of disciplines at Australian institutions.<br />\r\nAustralia is the safe, multicultural and internationally recognized environment for further education, innovative research intensive culture and international rapport has made Australia a leading provider of top quality education to international students from all over the world.', NULL, 2795, NULL, NULL, NULL, '/uploads/banner_image/1713343269_R (2).jpeg', NULL, NULL, NULL, NULL, 'why-canada', NULL, '1', '0', NULL, NULL, NULL, '2024-04-16 05:56:12', '2024-04-17 08:41:09', NULL, NULL, NULL, NULL, NULL),
