(2814, 'earning-while-studying-in-canada', 'earningwhilestudyingincanada', 'Earning While Studying in Canada', NULL, 'Main', 'Normal', NULL, 1, 'In Canada, international students can apply for permission to work. Student is permitted to work 20 hrs a week and full-time during vacations. But If you are studying masters or doctorate courses under subclass 574, then you are permitted to work unlimited hours a week.', NULL, NULL, NULL, 2811, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'earning-while-studying-in-canada', NULL, '1', '0', NULL, NULL, NULL, '2024-04-16 06:04:51', '2024-04-16 06:04:51', NULL, NULL, NULL, NULL, NULL),
(2815, 'student-visa-process-canada', 'studentvisaprocesscanada', 'Student Visa Processing', NULL, 'Main', 'Normal', NULL, 2, NULL, NULL, NULL, NULL, 2811, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'student-visa-process-canada', NULL, '1', '0', NULL, NULL, NULL, '2024-04-16 06:06:08', '2024-04-17 10:27:24', NULL, NULL, NULL, NULL, NULL),
(2816, 'processing-times-canada', 'processingtimescanada', 'Processing Times', NULL, 'Main', 'Normal', NULL, 3, 'Student applicants should lodge applications no more than 3 months and at least 8 weeks before course commencement dates. Some applications take longer to process. Students may be asked to undertake further medicals and some delays may be experienced due to the need to verify bank or education documents. Nepalese and Bhutanese applicants need to take into account the time taken for documents and letters to be sent and received by the Visa Office.<br />\r\nTo be granted a student visa you will need', NULL, NULL, NULL, 2811, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'processing-times-canada', NULL, '1', '0', NULL, NULL, NULL, '2024-04-16 06:07:29', '2024-04-16 06:07:29', NULL, NULL, NULL, NULL, NULL),
