(2822, 'canada-thee', 'canadathee', 'canada three', NULL, 'Main', 'Normal', NULL, 3, 'German credits are transferable. Social security is one of the finest in the World.', NULL, NULL, NULL, 2812, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'canada-two', NULL, '1', '0', NULL, NULL, NULL, '2024-04-16 12:41:53', '2024-04-16 12:44:02', NULL, NULL, NULL, NULL, NULL),
(2823, 'canada-q1', 'canadaq1', 'canada-q1', NULL, 'Main', 'Normal', NULL, 1, 'What are the basic requirements for Nepalese students to study in Canada?', NULL, 'A completed application, transcripts, test scores (such as IELTS or TOEFL for English language competency), proof of financial support, and a valid student visa may be required for Nepalese students to study in Canada.', NULL, 2813, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'canada-q1', NULL, '1', '0', NULL, NULL, NULL, '2024-04-16 12:46:49', '2024-05-30 22:06:29', NULL, NULL, NULL, NULL, NULL),
(2824, 'canada-q2', 'canadaq2', 'canada-q2', NULL, 'Main', 'Normal', NULL, 2, 'How do Nepalese students apply for a student visa to study in Canada?&nbsp;', NULL, 'Students from Nepal can apply for a student visa to study in Canada by providing the necessary documents, which include an institution\'s offer letter, a valid passport, proof of financial support, and passing a medical exam.', NULL, 2813, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'canada-q2', NULL, '1', '0', NULL, NULL, NULL, '2024-04-16 12:47:50', '2024-05-30 22:06:53', NULL, NULL, NULL, NULL, NULL),
(2825, 'why-uk', 'whyuk', 'Why Study in United Kingdom?', NULL, 'Main', 'Normal', NULL, 1, NULL, NULL, 'Uk growing up quickly as a popular study destination among the students around the world. Most of the students go to UK to study in the vocational education and training system and at university level. The most popular fields of study are business and management, information technology, engineering, and tourism and hospitality. Students these days are increasingly studying in a wide range of disciplines at UK institutions.<br />\r\nUK is the safe, multicultural and internationally recognized environment for further education, innovative research intensive culture and international rapport has made UK a leading provider of top quality education to international students from all over the world.', NULL, 2796, NULL, NULL, NULL, '/uploads/banner_image/1713271956_R (1).jpeg', NULL, NULL, NULL, NULL, 'why-uk', NULL, '1', '0', NULL, NULL, NULL, '2024-04-16 12:52:37', '2024-04-17 09:36:36', NULL, NULL, NULL, NULL, NULL),
