ogy</strong>&nbsp;&nbsp;</li>\r\n	<li><strong>Master of Arts in Arts Management</strong>&nbsp;&nbsp;</li>\r\n	<li><strong>Master of Science in Chemical Engineering</strong>&nbsp;&nbsp;</li>\r\n	<li><strong>Master of Science in Mechanical Engineering&nbsp;</strong></li>\r\n	<li><strong>Master of Science in Electrical Engineering&nbsp;</strong></li>\r\n	<li><strong>Doctor of Philosophy (Ph.D.) in Physics&nbsp;</strong></li>\r\n	<li><strong>Master of Science in Information Technology&nbsp;</strong></li>\r\n	<li><strong>Master of Science in Environmental Science</strong>&nbsp;&nbsp;</li>\r\n	<li><strong>Master of Science in Data Science&nbsp;</strong></li>\r\n	<li><strong>Master of Science in Biomedical Engineering</strong>&nbsp;</li>\r\n	<li><strong>Doctor of Philosophy (Ph.D.) in Mathematics</strong>&nbsp;</li>\r\n	<li><strong>Master of Science in Biotechnology</strong></li>\r\n	<li><strong>Doctor of Philosophy (Ph.D.) in Computer Science</strong></li>\r\n</ol>\r\n\r\n<div style=\"text-align: center;\"><br />\r\n<span style=\"font-size:20px;\"><strong><span style=\"color:#000000;\">Intake</span></strong></span></div>\r\n\r\n<div style=\"text-align: center;\">&nbsp;</div>\r\n\r\n<table border=\"1\" cellpadding=\"1\" cellspacing=\"1\" class=\"table\">\r\n	<thead>\r\n		<tr class=\"table-active\">\r\n			<th scope=\"col\">Intake&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</th>\r\n			<th scope=\"col\">Deadlines</th>\r\n		</tr>\r\n	</thead>\r\n	<tbody>\r\n		<tr>\r\n			<td>Fall</td>\r\n			<td>June&nbsp;</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Spring&nbsp;</td>\r\n			<td>October</td>\r\n		</tr>\r\n		<tr>\r\n			<td>Rolling Admissions</td>\r\n			<td>No Fixed deadline varies by university</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>', NULL, 2843, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Texas-Wesleyan-University-know-more', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 07:25:30', '2024-05-30 22:40:42', NULL, NULL, NULL, NULL, NULL),
(2858, 'service-two', 'servicetwo', 'Introduction', NULL, 'Main', 'Normal', NULL, 1, '<span style=\"font-size:18px;\"><strong>Introduction</strong></span><br />\r\nMay Education Consultancy is one of the best places for students aspiring to study abroad and test preparation. We are a professional’s team to provide outstanding supports for the deserving prospective students. We offer comprehensive test preparation, admissions services and financial advice to students for further education in the USA, Canada, UK, Ireland, Germany, Australia, Switzerland, Cyprus, Singapore &amp; India. Our goal is to offer the most innovative and time-saving admission information that will make the otherwise laborious application process as simple as possible', NULL, 'May Education Consultancy is stand quality service and reliability has formed the roots to the individual success for study abroad and future career since over the years. These strong roots have been nurtured by a strong belief that client’s satisfaction is the foundation upon which we are built. We are very successful because of our commitment to excellence in the services rendered by us. Our business goals are inseparable from that of our client’s needs. Our faith in quality is the key to corporate success in an increasing competitive global market. We strive to achieve excellence in all areas of performances. A considerable number of our students have already been attending some of the most well reputed colleges and universities abroad, in pursuit of shaping their future &amp; career. We are one of the best international student recruitment and Solutions Company in Nepal. Through our strong marketing network, we have built a professional platform for institutes and students to achieve their desired goals.<br />\r\n<strong>Mission</strong><br />\r\nThe designer Charles Eames once said, recalling a conversation he’d had with<br />\r\narchitect Eero Saarinen, that “the role of the architect or designer is that of a very<br />\r\ngood, thoughtful host…trying to anticipate<br />\r\n<br />\r\n<strong>Vision</strong><br />\r\nWhen I worked as a web designer, I was fascinated by how design trends changed<br />\r\neach year. Since hanging up my design boots and focusing on being CEO of Envato,<br />\r\nmy focus has shifted from visual', NULL, 2760, NULL, NULL, NULL, '/uploads/banner_image/1713342914_about.PNG', NULL, NULL, NULL, NULL, 'service-two', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 08:35:14', '2024-04-17 08:36:13', NULL, NULL, NULL, NULL, NULL),
