(2861, 'why-usa', 'whyusa', 'Why Study in U.S.A?', NULL, 'Main', 'Normal', NULL, 1, NULL, NULL, 'USA growing up quickly as a popular study destination among the students around the world. Most of the students go to Australia to study in the vocational education and training system and at university level. The most popular fields of study are business and management, information technology, engineering, and tourism and hospitality. Students these days are increasingly studying in a wide range of disciplines at USA institutions.<br />\r\nUSA is the safe, multicultural and internationally recognized environment for further education, innovative research intensive culture and international rapport has made Australia a leading provider of top quality education to international students from all over the world.', NULL, 2797, NULL, NULL, NULL, '/uploads/banner_image/1713343734_R (3).jpeg', NULL, NULL, NULL, NULL, 'why-usa', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 08:48:54', '2024-04-17 08:48:54', NULL, NULL, NULL, NULL, NULL),
