(2866, 'why-japan', 'whyjapan', 'Why Study in Japan?', NULL, 'Main', 'Normal', NULL, 1, NULL, NULL, 'Japan growing up quickly as a popular study destination among the students around the world. Most of the students go to Australia to study in the vocational education and training system and at university level. The most popular fields of study are business and management, information technology, engineering, and tourism and hospitality. Students these days are increasingly studying in a wide range of disciplines at Japanies institutions.<br />\r\nJapan is the safe, multicultural and internationally recognized environment for further education, innovative research intensive culture and international rapport has made Japan a leading provider of top quality education to international students from all over the world.', NULL, 2798, NULL, NULL, NULL, '/uploads/banner_image/1713344266_129160.jpg', NULL, NULL, NULL, NULL, 'why-japan', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 08:57:46', '2024-04-17 08:57:46', NULL, NULL, NULL, NULL, NULL),
