(2871, 'earning-while-study-uk', 'earningwhilestudyuk', 'Earning While Studying in United Kingdom', NULL, 'Main', 'Normal', NULL, 1, 'In United Kingdom, international students can apply for permission to work. Student is permitted to work 20 hrs a week and full-time during vacations. But If you are studying masters or doctorate courses under subclass 574, then you are permitted to work unlimited hours a week.', NULL, NULL, NULL, 2826, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'earning-while-study-uk', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 09:09:03', '2024-04-17 09:09:12', NULL, NULL, NULL, NULL, NULL),
(2872, 'student-visa-uk', 'studentvisauk', 'Student Visa Processing', NULL, 'Main', 'Normal', NULL, 2, 'Student visa applicants from India, Nepal and Bhutan are required to undergo a Pre-Visa Assessment (PVA).', NULL, NULL, NULL, 2826, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'student-visa-uk', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 09:10:57', '2024-04-17 10:29:04', NULL, NULL, NULL, NULL, NULL),
(2873, 'process-time', 'processtime', 'Processing Times', NULL, 'Main', 'Normal', NULL, 3, 'Student applicants should lodge applications no more than 3 months and at least 8 weeks before course commencement dates. Some applications take longer to process. Students may be asked to undertake further medicals and some delays may be experienced due to the need to verify bank or education documents. Nepalese and Bhutanese applicants need to take into account the time taken for documents and letters to be sent and received by the Visa Office.<br />\r\nTo be granted a student visa you will need', NULL, NULL, NULL, 2826, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'process-time', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 09:11:49', '2024-04-17 09:11:49', NULL, NULL, NULL, NULL, NULL),
(2874, 'student-visa-processing-uk', 'studentvisaprocessinguk', 'Student Visa Process', NULL, 'Main', 'Normal', NULL, 4, 'Process to obtain UK Student Visa for international students<br />\r\nAny person who intends to undertake full-time study in a registered course in UK needs to obtain a UK Student Visa. A Student Visa permits the holder to travel to, enter and remain in Australia for the duration of the registered course of study. Overseas students cannot undertake part-time study in UK and must leave UK on completion of their course of study.', NULL, NULL, NULL, 2826, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'student-visa-processing-uk', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 09:13:05', '2024-04-17 10:28:56', NULL, NULL, NULL, NULL, NULL),
