(2879, 'uk-one-fq', 'ukonefq', 'uk-one-fq', NULL, 'Main', 'Normal', NULL, 1, 'What are the reasons for UK Student Visa Refusals?&nbsp;', NULL, 'There are many causes for visa refusals, but these are a few of the most common:\r\n<ul>\r\n	<li>Failure to submit all necessary documentation with the visa application.</li>\r\n	<li>Providing false documentation or application information.</li>\r\n	<li>Failing to provide complete information about the course, university, study objective, or future career plan during the visa interview.</li>\r\n</ul>', NULL, 2828, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'uk-one-fq', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 09:28:09', '2024-05-30 22:07:23', NULL, NULL, NULL, NULL, NULL),
(2880, 'uk-two-fq', 'uktwofq', 'uk-two-fq', NULL, 'Main', 'Normal', NULL, 2, 'Why UK not other countries for study?', NULL, 'Students choose to study in the UK over other countries because of various reasons, including the quality of education, the reputation of UK universities, and the opportunity to immerse themselves in a different culture.', NULL, 2828, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'uk-two-fq', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 09:30:24', '2024-05-30 22:07:28', NULL, NULL, NULL, NULL, NULL),
