(2883, 'process-time-usa', 'processtimeusa', 'Processing Times', NULL, 'Main', 'Normal', NULL, 3, 'Process to obtain USA Student Visa for international students. Any person who intends to undertake full-time study in a registered course in USA needs to obtain a USA Student Visa. A Student Visa permits the holder to travel to, enter and remain in USA for the duration of the registered course of study. Overseas students cannot undertake part-time study in USA and must leave USA on completion of their course of study.', NULL, NULL, NULL, 2862, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'process-time-usa', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 09:45:40', '2024-04-17 09:45:40', NULL, NULL, NULL, NULL, NULL),
