(2889, 'usa-q-1', 'usaq1', 'usa-q-1', NULL, 'Main', 'Normal', NULL, 1, 'How much GPA is required to study in the USA?', NULL, 'Depending on the university and course of study, a minimum GPA of 2.5 to 3.0 on a 4.0 scale is usually required for acceptance to study in the United States.', NULL, 2864, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'usa-q-1', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 09:56:11', '2024-05-30 22:07:47', NULL, NULL, NULL, NULL, NULL),
(2890, 'usa-q-2', 'usaq2', 'usa-q-1', NULL, 'Main', 'Normal', NULL, 2, 'How much of a study gap is acceptable in the USA?&nbsp;', NULL, 'The US education system allows for one year of gap time, but if a student needs more than one year, they must give a valid reason with acceptable proof.', NULL, 2864, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'usa-q-2', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 09:56:39', '2024-05-30 22:07:52', NULL, NULL, NULL, NULL, NULL),
(2891, 'japan-q-1', 'japanq1', 'japan-q-1', NULL, 'Main', 'Normal', NULL, 1, 'How much bank balance is required to study in Japan?', NULL, 'The financial supporter must be preferably a direct member of your family, such as your spouse, parent or sibling.&nbsp;<b>At least 1,500,000 JPY (or equivalent in your currency at the time; approx.</b>&nbsp;<b>$12,000 USD)</b>&nbsp;shown in a bank statement for a 1 year student visa', NULL, 2869, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'japan-q-1', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 09:59:34', '2024-05-30 22:04:46', NULL, NULL, NULL, NULL, NULL),
(2892, 'japan-q-2', 'japanq2', 'japan-q-2', NULL, 'Main', 'Normal', NULL, 2, 'What is the success rate of a student visa in Japan?', NULL, 'Japan study visas are issued within a period of 2 to 4 weeks. Japan welcomes international students to study various courses like graduate degrees, postgraduate degrees, and master\'s degree courses. As the visa success rate is&nbsp;<b>up to 95%</b>, there is less chance of rejection.', NULL, 2869, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'japan-q-2', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 10:00:43', '2024-05-30 22:05:05', NULL, NULL, NULL, NULL, NULL),
(2893, 'japan-d-1', 'japand1', 'japan-d-1', NULL, 'Main', 'Normal', NULL, 1, 'All the academics documents till your recent degree', NULL, NULL, NULL, 2868, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'japan-d-1', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 10:02:52', '2024-04-20 06:21:20', NULL, NULL, NULL, NULL, NULL),
