(2896, 'earning-while-study-japan', 'earningwhilestudyjapan', 'Earning While Studying in Japan', NULL, 'Main', 'Normal', NULL, 1, 'In Japan, international students can apply for permission to work. Student is permitted to work 20 hrs a week and full-time during vacations. But If you are studying masters or doctorate courses under subclass 574, then you are permitted to work unlimited hours a week.', NULL, NULL, NULL, 2867, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'earning-while-study-japan', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 10:06:34', '2024-04-17 10:06:34', NULL, NULL, NULL, NULL, NULL),
(2897, 'student-visa-japan', 'studentvisajapan', 'Student Visa Processing', NULL, 'Main', 'Normal', NULL, 2, 'Student visa applicants from India, Nepal and Bhutan are required to undergo a Pre-Visa Assessment (PVA).x', NULL, NULL, NULL, 2867, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'student-visa-japan', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 10:08:47', '2024-04-17 10:34:18', NULL, NULL, NULL, NULL, NULL),
(2898, 'process-time-japan', 'processtimejapan', 'Processing Times', NULL, 'Main', 'Normal', NULL, 3, 'Student applicants should lodge applications no more than 3 months and at least 8 weeks before course commencement dates. Some applications take longer to process. Students may be asked to undertake further medicals and some delays may be experienced due to the need to verify bank or education documents. Nepalese and Bhutanese applicants need to take into account the time taken for documents and letters to be sent and received by the Visa Office.<br />\r\nTo be granted a student visa you will need', NULL, NULL, NULL, 2867, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'process-time-japan', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 10:09:47', '2024-04-17 10:09:47', NULL, NULL, NULL, NULL, NULL),
(2899, 'student-visa-processing -japan', 'studentvisaprocessing-japan', 'Student Visa Process', NULL, 'Main', 'Normal', NULL, 4, 'Process to obtain Japan Student Visa for international students. Any person who intends to undertake full-time study in a registered course in Japan needs to obtain a Japan Student Visa. A Student Visa permits the holder to travel to, enter and remain in Japan for the duration of the registered course of study. Overseas students cannot undertake part-time study in Japan and must leave Japan on completion of their course of study.', NULL, NULL, NULL, 2867, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'student-visa-processing -japan', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 10:11:09', '2024-04-17 10:35:44', NULL, NULL, NULL, NULL, NULL),
(2900, 'application-japan', 'applicationjapan', 'Application', NULL, 'Main', 'Normal', NULL, 6, 'Persons wishing to study in Japan should apply on form 157A and pay the current visa application charge.', NULL, NULL, NULL, 2826, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'application-japan', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 10:11:52', '2024-04-17 10:11:52', NULL, NULL, NULL, NULL, NULL),
(2901, 'student-visa-processing -canada', 'studentvisaprocessing-canada', 'Student Visa Process', NULL, 'Main', 'Normal', NULL, 4, 'Process to obtain Canada Student Visa for international students. Any person who intends to undertake full-time study in a registered course in Canada needs to obtain a Canada Student Visa. A Student Visa permits the holder to travel to, enter and remain in Canada for the duration of the registered course of study. Overseas students cannot undertake part-time study in Canada and must leave Canada on completion of their course of study.', NULL, NULL, NULL, 2811, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'student-visa-japan', NULL, '1', '0', NULL, NULL, NULL, '2024-04-17 10:28:18', '2024-04-17 10:28:18', NULL, NULL, NULL, NULL, NULL),
