(2957, 'State-University-of-New-York-know-more', 'stateuniversityofnewyorkknowmore', 'State University of New York (Oswego )', NULL, 'Main', 'Normal', NULL, 1, 'The State University of New York At Oswego or SUNY Oswego is 696 acres of lakeside campus in the city of Oswego, which is 35 miles northwest of Syracuse.The nationally recognized programmes for first-year students, options for service learning, internships and co-ops, study abroad, broad athletic opportunities and more than 180 clubs and associations make the institute an extraordinary college choice. SUNY Oswego offers students with more than 110 majors and minors through four divisions, namely College of Liberal Arts and Sciences, School of Business, School of Communication, Media and the Arts, and School of Education.The College of Liberal Arts and Sciences is SUNY Oswego\'s biggest academic division.At SUNY Oswego, students learn as much outside the study hall as they do in class. Oswego students get over $5 million in merit grant scholarships through the school\'s Presidential and Merit Scholarship program.', NULL, '<div style=\"text-align: justify;\">\r\n<div style=\"text-align: center;\">\r\n<div style=\"text-align: left;\"><strong>Bachelors&nbsp;Degree</strong><br />\r\nAvariety of Bachelor\'s degree programs in fields related to:&nbsp;</div>\r\n\r\n<ol>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts Management</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Fine Arts in Theatre Management</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts Administration</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts and Cultural Management&nbsp;</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Entertainment Management&nbsp;</strong></li>\r\n	<li style=\"text-align: left;\"><strong>Bachelor of Arts in Arts Management&nbsp;</strong></li>\r\n	<li style=\"text-align: left;\"><stron